import React from "react";
import {
  AppBar,
  Button,
  Grid,
  IconButton,
  Toolbar,
  Typography,
} from "@material-ui/core";
import MenuIcon from "@material-ui/icons/Menu";
import { blue } from "@material-ui/core/colors";

const styles = {
  menuButton: {},
  title: {},
  appBarStyle: {
    backgroundColor: "#000000",
  },
};

function Header(props) {
  return (
    <div>
      <Grid
        container
        direction="row"
        justify="center"
        alignItems="center"
        xs={1}
        spacing={5}
      >
        <AppBar color="transparent" elevation={0}>
          <Toolbar justify="flex-end">
            <Grid container item justify="flex-end" xs={12} spacing={5}>
              <Button size={"small"}>
                <MenuIcon style={{ color: "#9ca9b3" }} />
              </Button>
            </Grid>
          </Toolbar>
        </AppBar>
      </Grid>
    </div>
  );
}

export default Header;
